// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract L1Bridge is Ownable {
    ERC20 public token;
    uint256 public limit = 100 * 10**18; // Default limit set to 100 AGLD (assuming 18 decimals)
    // Mapping to store user deposits (for record-keeping only, tokens are not locked)
    mapping(address => uint256) public depositedBalances;

    // Event declarations
    event Deposit(address indexed user, uint256 amount, uint256 timestamp);
    event Withdrawal(address indexed user, uint256 amount, uint256 timestamp);

    // Constructor: Initialize the contract address of the ERC20 token
    constructor(address _tokenAddress) Ownable(msg.sender) {
        token = ERC20(_tokenAddress);
    }

    // Users deposit tokens, tokens are directly sent to the contract owner
    function deposit(uint256 amount) external {
        require(token.balanceOf(msg.sender) >= amount, "Insufficient balance");

        require(amount + depositedBalances[msg.sender] <= limit, "Deposit amount exceeds the limit");

        // Transfer tokens from the user's account to the contract owner
        bool success = token.transferFrom(msg.sender, owner(), amount);
        require(success, "Token transfer failed");

        // Update the user's deposit record (for record-keeping only)
        depositedBalances[msg.sender] += amount;

        // Trigger the Deposit event
        emit Deposit(msg.sender, amount, block.timestamp);
    }

    // Function to update the deposit limit, only callable by the owner
    function setLimit(uint256 newLimit) external onlyOwner {
        limit = newLimit;
    }

    // Withdrawal operation executed by the contract owner, tokens are transferred to the specified account
    function withdraw(address recipient, uint256 amount) external {
        // Log the start of execution
        require(token.balanceOf(msg.sender) >= amount, "Insufficient balance");
        require(msg.sender == owner(), "Caller is not the owner");

        // Transfer tokens from the contract owner's account to the specified account
        bool success = token.transferFrom(owner(), recipient, amount);
        require(success, "Token transfer failed");
     
        // Trigger the Withdrawal event
        emit Withdrawal(recipient, amount, block.timestamp);
    }
}
